  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Parker River
  NWR and Great Meadows NWR outlines Refuge accomplishments from January through April
  of 1956. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, mammals, and raptors- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, collections and receipts, and wildfires. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, fishing, and
  violations. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
